import React from 'react';
import ClientCard from './ClientCard';

const ClientManager = ({ clients = [] }) => {
  return (
    <div className="space-y-4">
      {clients.map(client => (
        <ClientCard key={client.id} client={client} />
      ))}
    </div>
  );
};

export default ClientManager;
